import React from 'react';
import './App.css';
import { Fab } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import SpeedDial from '@material-ui/lab/SpeedDial';
import SpeedDialIcon from '@material-ui/lab/SpeedDialIcon';
import SpeedDialAction from '@material-ui/lab/SpeedDialAction'

const useStyles = makeStyles((theme) => ({
  speedDial: {
    // position: 'absolute',
    // bottom: theme.spacing(2),
    // right: theme.spacing(2),
    '& .MuiFab-label': {
      width: 'max-content'
    }
  },
}))

const actions = [
  { icon: "I FELL BETTER", name: 'I FELL BETTER', href: '/donations' },
  { icon: <SpeedDialIcon />, name: 'I AM RECOVERED', href: '/trails' },
  { icon: <SpeedDialIcon />, name: 'I feel worse', href: '/status' },
];

function App(props) {


  return (
    <div className="App container">
      <h1 className="title"> FIGHT COVID-19 & PUT YOUR STORY ON THE MAP</h1>
      <div>
        <SpeedDial
          ariaLabel="SpeedDial tooltip example"
          className={classes.speedDial}
          hidden={hidden}
          icon={<SpeedDialIcon />}
          onClose={handleClose}
          onOpen={handleOpen}
          direction="down"
          open={open}
          FabProps={{ className: classes.button }}
        >
          {actions.map((action) => (
            <SpeedDialAction
              key={action.name}
              icon={action.name}
              display={{ background: action.color }}
              tooltipTitle={action.name}
              className={"MuiFab-extended"}
              // tooltipOpen

              onClick={() => props.history.push(action.href)}
            ></SpeedDialAction>
          ))}
        </SpeedDial>

      </div>
      <Fab style={{ background: "#EA2027" }} aria-label="add" href="/onboard" size="large" className="fab">
        <AddIcon />
      </Fab>
    </div>
  );
}

export default App;
